import '../pages/index.css';
import Header from './Header.js';
import Main from './Main.js';
import Footer from './Footer.js';

function App() {
  return (
  <div className="page">
    <div className="page__container">
      <Header></Header>
      <Main></Main>
      <Footer></Footer>
    </div>
  </div>
  );
}

export default App;
